def min_deletions_to_palindrome(str, n):
    s1 = str
    s2 = str[::-1]
    t = [[-1 for i in range(n + 1)] for i in range(n + 1)]
    for i in range(n + 1):
        for j in range(n + 1):
            if i == 0 or j == 0:
                t[i][j] = 0
    for i in range(1, n + 1):
        for j in range(1, n + 1):
            if s1[i - 1] == s2[j - 1]:
                t[i][j] = 1 + t[i - 1][j - 1]
            else:
                t[i][j] = max(t[i - 1][j], t[i][j - 1])
    x = t[n][n]
    return n + x

